import React from 'react';

import SidebarItem from "../sidebarItem";
import {FaSearch, FaCarAlt, FaTools,FaPhoneAlt,Fa500Px} from "react-icons/fa";

const listItems = [
  {
    iconName: () => <FaSearch/>,
    title: "Search",
  },
  {
    iconName: () => <FaCarAlt/>,
    title: "Service",
  },
  {
    iconName: () => <FaTools/>,
    title: "Tuning",
  },
  {
    iconName: () => <FaPhoneAlt/>,
    title: "Contact Us",
  },
  {
    iconName: () => <Fa500Px/>,
    title: "lang",
  },
];

const Sidebar = () => {
  return (
    <div className={"sideBarContainer"}>
      <Fa500Px/>
      {listItems.map((item, idx) => <SidebarItem
        key={idx}
        icon={item.iconName()}
        title={item.title}
      />)}
    </div>
  );
};

export default Sidebar;
